import Header from './Header';
import Home from './Home';
import About from './About';
import Footer from './Footer';
import {Routes, Route} from 'react-router-dom';
function Main() {
  return (
    <div className="App">
          <Header />
          <Routes>
            <Route path="/" element={<Home />}/>
          </Routes>
        
      <Footer />
    </div>
  );
}

export default Main;
